export interface JDSSearchResultProps {
    /** This determines the appearance of search results, it can be 'normal or 'box'. */
    kind?: 'normal' | 'box';
    /** It can be used to open or close search result items. */
    open?: boolean;
    /**  */
    offsetX?: string | number;
    /**  */
    offsetY?: string | number;
    /**  */
    headerAction?: React.ReactElement<any>;
    /**  */
    header?: React.ReactElement<any>;
    /**  */
    items?: React.ReactElement<any>;
    onClose?: () => void;
    custom?: string;
}
